import { CommonModule } from '@angular/common';
import { HttpClient } from '@angular/common/http';
import { AfterViewInit, ChangeDetectionStrategy, ChangeDetectorRef, Component, ViewChild } from '@angular/core';
import { FormBuilder, FormGroup, FormsModule, ReactiveFormsModule, Validators } from '@angular/forms';
import { MatBadgeModule } from '@angular/material/badge';
import { MatButtonModule } from '@angular/material/button';
import { MatChipsModule } from '@angular/material/chips';
import { MatExpansionModule } from '@angular/material/expansion';
import { MatFormFieldModule } from '@angular/material/form-field';
import { MatIconModule } from '@angular/material/icon';
import { MatInputModule } from '@angular/material/input';
import { MatSelectModule } from '@angular/material/select';
import { MatSnackBar, MatSnackBarModule } from '@angular/material/snack-bar';
import { MatSort, MatSortModule } from '@angular/material/sort';
import { MatTableDataSource, MatTableModule } from '@angular/material/table';

export interface PeriodicElement {
  name: string;
  id: number;
  pre_u: string;
  spm_result: string[];
  pre_u_result: string[];
  applied_program: string;
  action: string;
}

const ELEMENT_DATA: PeriodicElement[] = [
  {id: 1, name: 'Jess', pre_u: 'Foundation',spm_result:['English: A'], pre_u_result:['English: A'], applied_program: 'Software Engineering', action:''},
  {id: 1, name: 'Jing Yik', pre_u: 'STPM',spm_result:['English: A'], pre_u_result:['English: A'], applied_program: 'Software Engineering', action:''}

];

@Component({
  selector: 'app-view-applicants',
  standalone: true,
  imports: [
    CommonModule,
      MatTableModule,
      MatSortModule,
      MatFormFieldModule,
      MatSelectModule,
      MatInputModule,
      FormsModule,
      MatIconModule,
      MatExpansionModule,
      MatButtonModule,
      MatSnackBarModule,
      ReactiveFormsModule,
      MatChipsModule,
      MatBadgeModule
    ],
  templateUrl: './view-applicants.component.html',
  styleUrls: ['./view-applicants.component.css'],
  changeDetection: ChangeDetectionStrategy.OnPush,
})

export class ViewApplicantsComponent {
  displayedColumns: string[] = ['id', 'name', 'pre_u', 'spm_result', 'pre_u_result', 'applied_program', 'action'];
  dataSource = ELEMENT_DATA;
 }
